// src/components/FAQ.js

import React, { useState } from 'react';

const FAQ = () => {
  const [faqs, setFaqs] = useState([
    {
      question: 'What is the purpose of this website?',
      answer: 'The website serves as a portal for educational games and resources related to energy.',
    },
    {
      question: 'How can I contact support?',
      answer: 'You can contact support via the Contact Us page or through email at support@example.com.',
    },
    // ... add more FAQs as needed
  ]);

  return (
    <div className="faq-container">
      <h2>Frequently Asked Questions</h2>
      {faqs.map((faq, index) => (
        <div key={index} className="faq-item">
          <h3>{faq.question}</h3>
          <p>{faq.answer}</p>
        </div>
      ))}
    </div>
  );
}

export default FAQ;
